import React from "react";
import "./navBar.scss";
import { Link } from "react-router-dom";

const selected = (e) => {
  console.log(e.target.classList);
};

const NavBar = () => {
  return (
    <div className="container">
      <div className="dropdown-container">
        <ul className="dropdown-list" onClick={(e) => selected(e)}>
          <a href="#home">
            <li>Home</li>
          </a>
          <a href="#news">
            <li>News</li>
          </a>
          <li className="dropdown">
            <a href="#" className="dropbtn">
              Dropdown
            </a>
            <div className="dropdown-content">
              <a href="#">Link 1</a>
              <a href="#">Link 2</a>
              <a href="#">Link 3</a>
            </div>
          </li>

          <Link to="/spinner">
            <li id="spinner">Spinner</li>
          </Link>

          <Link to="/music">
            <li>Music</li>
          </Link>

          <Link to="/overlay">
            <li>Overlay</li>
          </Link>
        </ul>
      </div>
    </div>
  );
};

export default NavBar;
